import React from 'react';
import GuestItem from './GuestItem';

class TableItems extends React.Component {

    render() {

        const guests = [ 
            "Couple Wawa Leonard",
            "Couple Cédric Wawa",
            "Couple Bertrand Solotshi",
            "Couple Lwamba",
            "Couple Busho",
            "Couple Wawa Ruth"
        ];

        const printGuests = guests.map( guest => {
            return `<GuestItem name=${guest} />`;
        });
        return (
            <div className="ui blue cards tables" style={{margin:"0px 10px"}}>
                <div className="card">
                    <div className="content">  
                        <div className="center aligned header" style={{marginTop:"5px"}}>Noces de Cotton</div> 
                        <div className="center aligned meta">3 Places disponibles</div>
                        <br/>
                        <div className="description" style={{marginBottom:"10px"}}>
                            <div className="ui celled ordered list">
                                <GuestItem name="Couple Wawa Leonard" />
                                <GuestItem name="Couple Cédric Wawa" />
                                <GuestItem name="Couple Bertrand Solotshi" />
                                <GuestItem name="Couple Lwamba" />
                                <GuestItem name="Couple Busho" />
                                <GuestItem name="Couple Wawa Ruth" />
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default TableItems;
